import './App.css';
import Home from './screens/Home';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  // Link,
  // useRouteMatch,
} from "react-router-dom";
import Login from './screens/Login';

function App() {
  return (
   <Router>
   <div>
   <Routes>
    <Route exact path='/' element = {<Home/>}/>
    <Route eaxt path='/login' element = {<Login/>}/>
   </Routes>
   </div>

   </Router>
  );
}

export default App;
